import React, {Component} from 'react';
import Modal from '../Modal/Modal'

class FormList extends Component {
    render() {
        return (
            <React.Fragment>
                <h1>Form List</h1>
                <Modal></Modal>
            </React.Fragment>
        )
    }

}

export default FormList;
